/*
CyberChef 无法多线程执行  <@urlencode_all><@__TamperMonkey('http://127.0.0.1:8081/input','10f517bd4b8268f11c4637e941dab058')>{"input":"<@urlencode_all>阿曼达<@/urlencode_all>","script":"const inputElement = document.querySelector('#input-text > div:nth-child(1) > div:nth-child(2) > div:nth-child(1) > div:nth-child(1)'); inputElement.innerText = msg.input; async function getOutput() { await new Promise(resolve => setTimeout(resolve, 1000));  const outputElement = document.querySelector('#output-text > div:nth-child(1) > div:nth-child(2) > div:nth-child(1)'); return outputElement.innerText} getOutput().then(_output => {result(msg,_output) });"}<@/__TamperMonkey><@/urlencode_all>
*/



(function () {
    'use strict';

    let SERVER = GM_getValue('SERVER', 'http://127.0.0.1:8081');
    let TITLE = 'Burp Ext';

    let main = {

        menu_id: -1,

        registerMenuCommand() {

            this.menu_id = GM_registerMenuCommand('连接：×', () => {
                this.connect();
                unsafeWindow.GM_setValue = GM_setValue;
                unsafeWindow.GM_getValue = GM_getValue;
                unsafeWindow.GM_addStyle = GM_addStyle;
                unsafeWindow.GM_deleteValue = GM_deleteValue;
                unsafeWindow.GM_listValues = GM_listValues;
                unsafeWindow.GM_addValueChangeListener = GM_addValueChangeListener;
                unsafeWindow.GM_removeValueChangeListener = GM_removeValueChangeListener;
                unsafeWindow.GM_log = GM_log;
                unsafeWindow.GM_getResourceText = GM_getResourceText;
                unsafeWindow.GM_getResourceURL = GM_getResourceURL;
                unsafeWindow.GM_registerMenuCommand = GM_registerMenuCommand;
                unsafeWindow.GM_unregisterMenuCommand = GM_unregisterMenuCommand;
                unsafeWindow.GM_openInTab = GM_openInTab;
                unsafeWindow.GM_xmlhttpRequest = GM_xmlhttpRequest;
                unsafeWindow.GM_download = GM_download;
                unsafeWindow.GM_getTab = GM_getTab;
                unsafeWindow.GM_saveTab = GM_saveTab;
                unsafeWindow.GM_getTabs = GM_getTabs;
                unsafeWindow.GM_notification = GM_notification;
                unsafeWindow.GM_setClipboard = GM_setClipboard;
                unsafeWindow.GM_info = GM_info;
            });

            GM_registerMenuCommand('设置', () => {
                let _server = prompt('请输入服务器地址', SERVER);
                if (_server) {
                    GM_setValue('SERVER', _server);
                    SERVER = _server;
                }
            });

        },

        result(msg, output) {

            // 定义要发送的数据
            const bodydata = {
                id: msg.id,
                input: msg.input,
                output: output
            };

            // 发送 POST 请求
            fetch(`${SERVER}/result`, {
                method: "POST",
                headers: {
                    "Content-Type": "application/json"
                },
                body: JSON.stringify(bodydata)
            }).then((response) => {
                let data = response.json();
                console.log("发送结果:", bodydata);
            }).catch((error) => {
                console.log("ERROR", error);
            });
        },

        cal(msg) {
            try {
                // 解析消息
                msg = JSON.parse(msg);
                console.log('收到消息:', msg);

                let output;
                let script = msg.script;
                eval(script);

            } catch (error) {
                console.error("处理消息出错:", error);
                this.result(msg, msg.input);
            }
        },

        connect() {
            // 创建一个新的 EventSource 实例
            const eventSource = new EventSource(`${SERVER}/sse`);

            // 监听 'message' 事件
            eventSource.onmessage = (event) => {
                this.cal(event.data);
            };

            // 监听 'error' 事件
            eventSource.onerror = (error) => {
                GM_notification(TITLE, `SSE 连接出错`);
                if (this.menu_id !== -1) {
                    GM_unregisterMenuCommand(this.menu_id);
                    this.menu_id = GM_registerMenuCommand('连接：×', () => {
                        this.connect();
                    });
                }
            };

            // 监听 'open' 事件
            eventSource.onopen = () => {
                GM_notification(TITLE,'SSE 连接已打开');
                GM_unregisterMenuCommand(this.menu_id);
                this.menu_id = GM_registerMenuCommand('连接：√', () => { });
            };
        },

        isTopWindow() {
            return window.self === window.top;
        },

        init() {
            if (this.isTopWindow()) {
                this.registerMenuCommand();

            };
        },

    };


    main.init();

})();
